import LinkButton from "./LinkButton";

function MyListNav() {
  return (
    <nav>
      <ul className="flex flex-row">
        <li>
          <LinkButton to="/watch">Watch</LinkButton>
        </li>
        <li>
          <LinkButton to="/watched">Watched</LinkButton>
        </li>
      </ul>
    </nav>
  );
}

export default MyListNav;
